import React from 'react'
import { MainContainer, SmallText } from '../MainSection/MainSectionDecorations'

const index = () => {
  return (
    <MainContainer>
      <SmallText>Celem aplikacji jest zbieranie podpisanych zdjęć żywności,
        które potem użyjemy do zbudowania modelu sieci neuronowej.
        Dziękujemy za wkład i poświęcony czas.
      </SmallText>
    </MainContainer>
  )
}

export default index
